const light = {
  bg: 'white',
  fontColor: 'purple',
  snavbg: '#F8F8F8',
  navlinkhoverbg: 'white',
  navlinkhoverclr: 'black',
  navlinkclr: '#31373d',
  /* Theme floating button */
  floatingbg: '',
  sunicon: 'show',
  moonicon: 'none'
}

const dark = {
  bg: 'black',
  fontColor: 'white',
  snavbg: '#242526',
  navlinkhoverbg: 'black',
  navlinkhoverclr: 'white',
  navlinkclr: '#b6b6b6',
  /* Theme floating button */
  floatingbg: '#242526',
  sunicon: 'none',
  moonicon: 'show'
}

export const darkTheme = { ...dark }
export const lightTheme = { ...light }
